import React from 'react'
import './../App.css';

function Home() {
    return (
        <div>
             <div className="welcome-text">
                 <span>Welcome to</span>
            </div>
            <div className="family-tree-text">
                 <span>FAMILY TREE</span>
            </div>
            <div className="connects-all-the-leaves">
                <span>connects all the leaves</span>
            </div>
        </div>
       
    )
}

export default Home;
